import React, { Fragment } from "react";

function CurrentDeck() {
  const currentDeck = {
    name: "Deck name",
    description: "a brief deck description",
  };

  return (
    <Fragment>
      <h3>{currentDeck.name}</h3>
      <h2>Cards</h2>
    </Fragment>
  );
}

export default CurrentDeck;
